window.bookSummaryJSON = "<p><b>Don't miss the </b><b><i>Morcster Chef </i></b><b>Complete Series Box Set, a LitRPG adventure that will appeal to anyone who enjoys listening to a slice-of-life fantasy about a group of adventurer, as well as fans of </b><b><i>Food Wars!.</i></b> </p> <p>Adventurers seek dungeons for riches. Heroes storm great fortresses. Gods clash far above.</p> <p>Arek cooks lasagna and tops it with a dash of finely chopped basil.</p> <p>An orc who has seen more than his fair amount of fighting, Arek wants nothing more than to spend the rest of his days cooking and away from the chaos of combat.</p> <p>However, when Ming and her group of adventurers hire him as their full-time chef, his plans of avoiding violence crumble. He longs to leave his blood-soaked mistakes in his past, but old friends and foes have different ideas.</p> <p><b><i>Morcster Chef</i></b><b> is a Fantasy-LitRPG lite series with a cooking element that is perfect for the Holiday Season. It contains status windows and other RPG elements, but it is not set within a videogame.</b></p> <p><i>This Series also contains real recipes, and we highly recommend you give them a taste if youâ€™re hungry!</i></p>"; 
